import React from 'react';
import Button from './Button'
import { Typography, Card, CardContent, CardActions } from '@material-ui/core';

const QuoteMachine = (props) => {
  return (
    <React.Fragment>
      {/* <h2>
          { props.selectedQuote ? props.selectedQuote.quote : "failed" }
        </h2> */}
      <Card>
        <CardContent>
          {
            props.selectedQuote
              ?
              (
                <Typography>
                  {props.selectedQuote.quote} - {props.selectedQuote.author}
                </Typography>
              )
              : null
          }
        </CardContent>
        <CardActions>
          <Button
            size="small"
            buttonDisplayName="Quote Get"
            clickHandler={
              props.assignIndex
            }
            
          />
        </CardActions>
      </Card>

    </React.Fragment>
  )
}

export default QuoteMachine;
